    true,nt"url": null,nt"notes": "NIST has accumulated a valuable and comprehensive
    collection of thermal conductivity data from measurements performed with a 200-mm
    square guarded-hot-plate apparatus. The guarded-hot-plate test method is arguably
    the most accurate and popular method for determination of thermal transmission properties
    of flat, homogeneous specimens under steady state conditions. Several organizations,
    including ASTM and ISO, have standardized the method.   Version 1.0 of the database
    includes data for over 2000 measurements, covering several categories of materials
    including concrete, fiberboard, plastics, thermal insulation, and rubber. The data
    cover a temperature range corresponding to most building applications; however,
    the majority of the measurements were conducted at 24u00b0 C (75u00b0 F).  Web version
